import React from 'react';
import {Movie} from "./FetchMovies";

type Prop = {
    movie: Movie
}
const MovieComponent = ({movie}: Prop) => {
    return (
        <li>
            <h1>{movie.original_title}</h1>
        </li>
    );
};

export default MovieComponent;
